import React from "react";
import { Typography, Box, Stack, Modal, styled, Button } from "@mui/material";
import { Link } from "react-router-dom";
import { fontWeight } from "@mui/system";
import CloseIcon from '@mui/icons-material/Close';

const StyledModal = styled(Modal)({
  display: "flex",
  alignItems: "center",
  justifyContent: "center",
});

const style = {
  position: "absolute",
  top: "50%",
  left: "50%",
  transform: "translate(-50%, -50%)",
  width: 700,
  height: 500,
  background: `linear-gradient(pink, lightblue)`,
  border: "3px solid #555",
  borderRadius: 10,
  boxShadow: 24,
  pt: 2,
  px: 4,
  pb: 3,
  '&::-webkit-scrollbar' : {
    width: '10px'
  }
};

const StyledTitle = styled(Typography)({
  fontSize: 30,
  fontWeight: "bold",
});

const StyledButton = styled(Button)({
  backgroundColor : '#0063D8',
  color : 'white',
  fontWeight : 'bold',
  width : 200,
  marginTop : 10
})


const TokenList = ({ open, handleClose }) => {
  return (
    <Modal
      // hideBackdrop
      open={open}
      onClose={handleClose}
      aria-labelledby="child-modal-title"
      aria-describedby="child-modal-description"
    >
      <Box sx={{ ...style }} style={{ overflowY: "scroll" }}>
        <CloseIcon style={{fontSize:40,float:'right', cursor:'pointer'}} onClick={handleClose}/>
        <Box style={{border : '2px solid black', marginTop : 50, padding : 10}}>
          <Stack direction="row" gap={10}>

            <Box style={{ padding: 5}}>
              <StyledTitle>제목</StyledTitle>

              <Typography style={{ alignItems: "center", display: "flex" }}>
                보기
              </Typography>
              <StyledButton>Buy NFT</StyledButton>
            </Box>
          </Stack>
          <Box style={{ padding: 5, marginTop : 10 }}>
            <StyledTitle>NFT Description</StyledTitle>
          </Box>
        </Box>
        <Typography></Typography>
      </Box>
    </Modal>
    // <div>

    //   Modal
    //   보유한 토큰 목록, 양
    //   토큰 추가
    //   <Box sx={{ p: 3 }}>
		// 		<Stack spacing={3} direction="column" justifyContent="center" alignItems="center">
    //       <Typography variant="h6">Token List</Typography>
    //     </Stack>
    //   </Box>
    // </div>
  );
};

export default TokenList;
